","playgroundQueryUuid","","playgroundQueryId",null,"error",null,"workflowRunBodyType","raw","privateParams",["^E",[]],"queryRunOnSelectorUpdate",false,"runWhenPageLoadsDelay","","warningCodes",["^E",[]],"data",null,"recordId","","importedQueryInputs",["^1E",[]],"_additionalScope",["^E",[]],"isImported",false,"showSuccessToaster",false,"dataArray",["^E",[]],"cacheKeyTtl","","filterBy","","requestSentTimestamp",null,"databaseHostOverride","","metadata",null,"editorMode","sql","queryRunTime",null,"actionType","","changesetObject","","shouldUseLegacySql",false,"offlineOptimisticResponse",null,"errorTransformer","return data.error","finished",null,"databaseNameOverride","","confirmationMessage",null,"isFetching",false,"changeset","","rawData",null,"queryTriggerDelay","0","resourceTypeOverride",null,"watchedParams",["^E",[]],"enableErrorTransformer",false,"databaseWarehouseOverride","","enableBulkUpdates",false,"showLatestVersionUpdatedWarning",false,"timestamp",0,"importedQueryDefaults",["^1E",[]],"enableTransformer",true,"showUpdateSetValueDynamicallyToggle",false,"overrideOrgCacheForUserCache",false,"bulkUpdatePrimaryKey","","runWhenPageLoads",false,"transformer","// Convert column-format data to array of objects
const rows = data.item.map((item, i) => ({
  item,
  platform: data.platform[i],
  velocity: data.velocity[i]
}));

// Step 1: Get top 3 platforms by total velocity
const totals = {};
rows.forEach(r => {
  if (!totals[r.platform]) totals[r.platform] = 0;
  totals[r.platform] += r.velocity;
});
const top3 = Object.entries(totals)
  .sort((a, b) => b[1] - a[1])
  .slice(0, 3)
  .map(([platform]) => platform);

// Step 2: Theme colors per platform
const colorMap = {
  [top3[0]]: "#3F728E", // Primary
  [top3[1]]: "#F5973E", // Secondary
  [top3[2]]: "#5E9E9D"  // Success
};

// Step 3: Collect top 10 per platform
const grouped = {};
rows.forEach(r => {
  if (!top3.includes(r.platform)) return;
  if (!grouped[r.platform]) grouped[r.platform] = [];

  if (grouped[r.platform].length < 10) {
    grouped[r.platform].push({
      Id: `${r.item} (${r.platform})`,
      Label: `${r.item}\n${r.velocity.toFixed(1)} net/day`,
      Parent: r.platform,
      Value: r.velocity,
      Color: colorMap[r.platform]
    });
  }
});

// Step 4: Add parent nodes (platforms)
const parents = top3.map(platform => ({
  Id: platform,
  Label: platform,
  Parent: "",
  Value: 0,
  Color: colorMap[platform]
}));

return [...parents, ...Object.values(grouped).flat()];
