-- Generates long-format stacked bar input: category, platform, net
WITH category_net AS (
  SELECT category, SUM(total_net) AS total_net
  FROM inventory
  WHERE category IS NOT NULL
  GROUP BY category
),
top_categories AS (
  SELECT category FROM (
    SELECT category FROM category_net ORDER BY total_net DESC LIMIT 10
  ) AS top10
),
bottom_categories AS (
  SELECT category FROM (
    SELECT category FROM category_net ORDER BY total_net ASC LIMIT 10
  ) AS bottom10
),
top_bottom_categories AS (
  SELECT category FROM top_categories
  UNION
  SELECT category FROM bottom_categories
)
